component.schema:
{
 "description": "TenantGateway is the Schema for the tenantgateways API",
 "properties": {
  "spec": {
   "description": "TenantGatewaySpec defines the desired state of TenantGateway",
   "properties": {
    "baseDomain": {
     "description": "BaseDomain is a record to auto generate domain in ingress.",
     "type": "string"
    },
    "configMapData": {
     "additionalProperties": {
      "type": "string"
     },
     "description": "Initial values of the Ingress Controller ConfigMap.\nCheck https://docs.nginx.com/nginx-ingress-controller/configuration/global-configuration/configmap-resource/ for\nmore information about possible values.",
     "nullable": true,
     "type": "object"
    },
    "image": {
     "description": "The image of the Ingress Controller.",
     "properties": {
      "pullPolicy": {
       "description": "The ImagePullPolicy of the image.",
       "type": "string"
      },
      "repository": {
       "description": "The repository of the image.",
       "type": "string"
      },
      "tag": {
       "description": "The tag (version) of the image.",
       "type": "string"
      }
     },
     "required": [
      "pullPolicy",
      "repository",
      "tag"
     ],
     "type": "object"
    },
    "ingressClass": {
     "description": "IngressClass 用以区分nginx作用域",
     "type": "string"
    },
    "replicas": {
     "description": "Replicas 负载均衡实例数",
     "format": "int32",
     "type": "integer"
    },
    "service": {
     "description": "The service of the Ingress controller.",
     "nullable": true,
     "properties": {
      "extraAnnotations": {
       "additionalProperties": {
        "type": "string"
       },
       "type": "object"
      },
      "extraLabels": {
       "additionalProperties": {
        "type": "string"
       },
       "description": "Specifies extra labels of the service.",
       "type": "object"
      },
      "ports": {
       "description": "Ports specifies the ports of the service.",
       "items": {
        "description": "ServicePort contains information on service's port.",
        "properties": {
         "appProtocol": {
          "description": "The application protocol for this port.\nThis field follows standard Kubernetes label syntax.\nUn-prefixed names are reserved for IANA standard service names (as per\nRFC-6335 and http://www.iana.org/assignments/service-names).\nNon-standard protocols should use prefixed names such as\nmycompany.com/my-custom-protocol.",
          "type": "string"
         },
         "name": {
          "description": "The name of this port within the service. This must be a DNS_LABEL.\nAll ports within a ServiceSpec must have unique names. When considering\nthe endpoints for a Service, this must match the 'name' field in the\nEndpointPort.\nOptional if only one ServicePort is defined on this service.",
          "type": "string"
         },
         "nodePort": {
          "description": "The port on each node on which this service is exposed when type is\nNodePort or LoadBalancer.  Usually assigned by the system. If a value is\nspecified, in-range, and not in use it will be used, otherwise the\noperation will fail.  If not specified, a port will be allocated if this\nService requires one.  If this field is specified when creating a\nService which does not need it, creation will fail. This field will be\nwiped when updating a Service to no longer need it (e.g. changing type\nfrom NodePort to ClusterIP).\nMore info: https://kubernetes.io/docs/concepts/services-networking/service/#type-nodeport",
          "format": "int32",
          "type": "integer"
         },
         "port": {
          "description": "The port that will be exposed by this service.",
          "format": "int32",
          "type": "integer"
         },
         "protocol": {
          "default": "TCP",
          "description": "The IP protocol for this port. Supports \"TCP\", \"UDP\", and \"SCTP\".\nDefault is TCP.",
          "type": "string"
         },
         "targetPort": {
          "anyOf": [
           {
            "type": "integer"
           },
           {
            "type": "string"
           }
          ],
          "description": "Number or name of the port to access on the pods targeted by the service.\nNumber must be in the range 1 to 65535. Name must be an IANA_SVC_NAME.\nIf this is a string, it will be looked up as a named port in the\ntarget Pod's container ports. If this is not specified, the value\nof the 'port' field is used (an identity map).\nThis field is ignored for services with clusterIP=None, and should be\nomitted or set equal to the 'port' field.\nMore info: https://kubernetes.io/docs/concepts/services-networking/service/#defining-a-service",
          "x-kubernetes-int-or-string": true
         }
        },
        "required": [
         "port"
        ],
        "type": "object"
       },
       "type": "array",
       "x-kubernetes-list-map-keys": [
        "port",
        "protocol"
       ],
       "x-kubernetes-list-type": "map"
      }
     },
     "type": "object"
    },
    "tenant": {
     "description": "Tenant 租户名",
     "type": "string"
    },
    "type": {
     "description": "Type 负载均衡类型",
     "type": "string"
    },
    "workload": {
     "description": "The Workload of the Ingress controller.",
     "nullable": true,
     "properties": {
      "extraLabels": {
       "additionalProperties": {
        "type": "string"
       },
       "description": "Specifies extra labels of the workload(deployment) of nginx.",
       "type": "object"
      },
      "resources": {
       "description": "Specifies resource request and limit of the nginx container",
       "properties": {
        "limits": {
         "additionalProperties": {
          "anyOf": [
           {
            "type": "integer"
           },
           {
            "type": "string"
           }
          ],
          "pattern": "^(\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))(([KMGTPE]i)|[numkMGTPE]|([eE](\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))))?$",
          "x-kubernetes-int-or-string": true
         },
         "description": "Limits describes the maximum amount of compute resources allowed.\nMore info: https://kubernetes.io/docs/concepts/configuration/manage-resources-containers/",
         "type": "object"
        },
        "requests": {
         "additionalProperties": {
          "anyOf": [
           {
            "type": "integer"
           },
           {
            "type": "string"
           }
          ],
          "pattern": "^(\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))(([KMGTPE]i)|[numkMGTPE]|([eE](\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))))?$",
          "x-kubernetes-int-or-string": true
         },
         "description": "Requests describes the minimum amount of compute resources required.\nIf Requests is omitted for a container, it defaults to Limits if that is explicitly specified,\notherwise to an implementation-defined value.\nMore info: https://kubernetes.io/docs/concepts/configuration/manage-resources-containers/",
         "type": "object"
        }
       },
       "type": "object"
      }
     },
     "type": "object"
    }
   },
   "required": [
    "tenant"
   ],
   "type": "object"
  }
 },
 "title": "Tenant Gateway",
 "type": "object"
}
